import React, { Component } from 'react';
import './App.css';
import { Connector } from 'mqtt-react';

import _MessageContainer from './mqtt/MessageContainer';
import { subscribe } from 'mqtt-react';

//const MessageContainer = subscribe({topic: 'restaurant/buttons'})(_MessageContainer);

const _MessageList = (props) => (
  <ul>
    {props.data.map( message => <li>{message}</li> )}
  </ul>
);

const customDispatch = function(topic, message, packet) {
  console.log(message)
}

// simple subscription to messages on the "@test/demo" topic
const MessageList = subscribe({
  topic: 'restaurant/buttons',
  dispatch: customDispatch
})(_MessageList)

class App extends Component {


  render() {

    return (
      <Connector mqttProps="ws://192.168.100.103:12345/">
        <div className="App">
          <div className="App-header">
          </div>

        </div>
      </Connector>
    );
  }
}

export default App;
